import styled from "styled-components";
import React from "react";
import{ReactComponent as CoffeSVG} from '../assets/coffeecup.svg'
import{ReactComponent as CakeSVG} from '../assets/cake.svg'
import{ReactComponent as SteakSVG} from '../assets/steak.svg'


const CategoriesContainer = styled.div`
    display: flex;
    width: 100%;    
    justify-content: space-evenly;
`

const CoffeeIcon = styled(CoffeSVG)`
    width: 50px;
    height: 50px;
`
const SteakIcon = styled(SteakSVG)`
    width: 50px;
    height: 50px;
`
const DessertIcon = styled(CakeSVG)`
    width: 50px;
    height: 50px;
`


const Categories = ({categories}) =>{

    return(
        <CategoriesContainer>
            <CoffeeIcon />
            <SteakIcon />
            <DessertIcon />
            
        </CategoriesContainer>
    )
}

export default Categories;
